      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 - - + col0 + + 67 * + 64 + + - 27 NOT BETWEEN + + ( + col1 ) * + col2 - 56 AND ( + col1 + - col0 );
  - name: tab1

outputs:
  - name: q13677.out
    data: |
      51	14	96
      85	5	59
      91	47	68
